const chats = [
    {
        id:1,
        msgType:"received",
        msgs:["Hiii","How are you?","I hope you are having a good day today !"],
    },
    {
        id:2,
        msgType:"sent",
        msgs:["Hello","I am good","What about you?"],
    },
    {
        id:3,
        msgType:"received",
        msgs:["I have a doubt in Maths.","Could you help me?"],
    },
    {
        id:4,
        msgType:"sent",
        msgs:["Sure","Could you send me the picture of it?"],
    },
    {
        id:5,
        msgType:"received",
        msgs:["yaa","sending in some time.","thanks in advance."],
    },
    {
        id:6,
        msgType:"sent",
        msgs:["No problem","take your time."],
    },
]
export default chats;
